class Form extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "",
      phone: "",
      email: "",
      message: "",
      disable: false,
      emailSent: null,
    };
  }
  render() {
    return <p>this is form</p>;
  }
}

export default Form;
